    "2015-11-20T10:49:57.098854",nt"name": "2005-progress-report-riparian-willow-restoration-along-the-illinois-river-at-arapahoe-nwr-",nt"isopen":
    false,nt"url": null,nt"notes": "This is a progress report concerning riparian
    willow restoration on Arapahoe NWR. Riparian willow communities along the Illinois
    River at Arapaho NWR provide important habitat for a number of wildlife species,
    including neotropical migratory birds. Existing stands are sparse and discontinuous
    throughout much of the Refuge and appear averaged, with little natural regeneration.
    Likely causes include historical clearing; reduced streamflow from water diversion;
    channel incision perhaps related to diminished sediment supply; possible climatic
    shifts; and high levels of herbivory from cattle, introduced moose, and elk, which
    have recently increased densities and altered distributions.",nt"license_title":
